import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import { Box, Grid } from '@mui/material';
import proto from '../pb/proto_grpc_web_pb';

var subastaService = new proto.SubastaServiceClient('http://0.0.0.0:8000');

export default function JoinSubasta(){
    const { id } = useParams();
    const [subasta, setSubasta] = useState(null);

    function getSubasta() {
        var request = new proto.SubastaId();
        request.setId(id)
        var metadata = {};

        subastaService.getSubasta(request, metadata, (err, response) => {
          if (err) {
            console.log(err.code, err.message);
          } else {
            let subasta = response.getSubasta();
            setSubasta(subasta);
          }
        });
      }

    useEffect(()=>{
        getSubasta();
    }, [])

    return (
        <>
            <Box sx={{ paddingTop: 4 }}>
            <Grid container spacing={2}>
                <Grid item xs={12}>                    
                    { subasta?.subasta }
                </Grid>
            </Grid>
            <div>JoinSubasta - {id}</div>
            </Box>
        </>
    )
}
